import React from 'react'
//import {NavLink} from "react-router-dom";

const Buyers= () => {
    return (
        <div className='buyers' id='buy-sell'>
          <div className='container-main'>
              <div className='buyers-wrapper'>
                  <div className='section-buying'>
                      <h2>BUY WITH US</h2>
                  </div>
              </div>
          </div>
        </div>
    )
}

export default Buyers
